%[text] # Tekercs
R = 1;
L = 1e-3;

tau = L/R %[output:8b9173c1]
K = 1/R %[output:3f8a6795]

omega_0 = 1/tau %[output:82a1678e]
omega = (omega_0/10):10:(omega_0*10) %[output:8851763f]

A = @(w) K ./ sqrt(1 + tau^2*w.^2);
Dq = @(w) -atan(tau*w);

loglog(omega, A(omega)); %[output:99617c29]
semilogx(omega, rad2deg(Dq(omega))); %[output:7858b8f4]

